import React, { useEffect, useState } from "react";

    function TweetInfo() {
        const [data, setData] = useState(null);
        useEffect(() => {
            fetch(`https://api.twitter.com/2/tweets/search/recent?query=facialrecognition`)
            .then(res => res.json())
            .then(setData)
            .catch(console.error);
        }, []);
    
        if(data) {
            return(
                <div>
                    <h1>{data}</h1>
                </div>
            )
        }
        return null;
    }
    export default TweetInfo;
